  02> WILLIAMS, Graeme Denys m on 03.03.1990 to MCKAY, Seann Florence
  b 26.10.1961
  b 30.10.1960
  Graeme b. at Te Puia Springs and m. at Havelock North. Seann, d/o William McKay and Alison Joyce
  Hogan, b. at Hastings. Address: Mangaroa Station, RD, Tokomaru Bay.
  Graeme was educated at Wanganui Collegiate School (1975-78, awarded a scholar's tie) and Flock
  House (1979). He gained a scholarship at Brooksby Agricultural College, Melton Mowbray,
  Leicestershire, where he passed the National Certificate in Agriculture with distinction. He
  returned to New Zealand in 1982 and mustered and shore in Matawhai and the Upper Rangitata Gorge
  high country before returning to farm at "Mangaroa" in partnership with his father in 1986, taking
  over the property in 1998. He obtained a Certificate in Farm Management in 1984 and published a
  book of poems, "Ribtickling Rhymes", in 1990.
  Graeme is a keen mountaineer - in 1995 he climbed Whanokao and Hikurangi on the same day and the
  following year he climbed Hikurangi, Wharekia and Aorangi on the same day. He climbed Mount Cook
  via the Linda Glacier in 1997 and Ruapehu in 1998. Later in 1998 he joined Russell Brice's
  expedition to climb Mount Everest via the North Ridge in Tibet. Whilst Graeme was evacuated, the
  others in the party were successful in reaching the summit.
  Seann was educated at Te Mahia, Mangateretere and Parkvale Schools, Hastings Intermediate,
  Poringland School, Norwich, England (1969) and Karamu High School, Hastings. She worked for a year
  on dairy and sheep farms and trained racehorses at Te Puke, then attended Lincoln College to gain a
  Diploma in Horticulture. She attended Palmerston North Teachers' College (1981-84) and qualified
  as a primary school teacher. From 1985 to 1987 she worked in the feral deer and goat recovery
  industry, driving, farming and selling. She then taught at Flaxmere Intermediate, Whatatutu and
  Tolaga Bay. Her interests include painting, horses and breeding black angora goats.
